_R7(_z5._t7,_38);var _u7="Спасибо! А вот и обещанный факт!##Знаешь, почему пчёлы жужжат? Пчёлы машут своими#крылышками с частотой около 200 раз в секунду!#Такие быстрые движения вызывают колебания #воздуха, воспринимаемые нашим ухом как звук.##К сожалению, это не все пчёлы, я был бы очень#признателен, если бы ты поискал ещё, а я бы тебе#рассказал ещё какой-нибудь факт.";_R7(_z5._t7,_u7);var _u7="Ты нашёл ещё, спасибо! Вот тебе исторический факт!##Пчеловодство очень старое занятие, им занимались#ещё древние египтяне около 5000 лет назад! Египтяне#почитали и изображали пчёл на обелисках. Вцелом#нашлись доказательства сбора людьми мёда и#9000 лет назад.##Не все пчёлы любят, когда к ним приближаешься, так#что не удивляйся, если они вдруг улетят, завидев#тебя.";
_R7(_z5._t7,_u7);var _u7="Как и договаривались, вот ещё факт.##Пчёлы обладают довольно острым обонянием, они#способы учуять нектар на расстоянии до 1 километра!#Пчела может улететь от улья почти на 8 км и#безошибочно найти дорогу. Однако при этом пчёлы#очень плохо видят и не способны различать объекты#расположенные дальше полутора метров.##Похоже половина пчёл уже на месте, спасибо!#Но кажется вон там я вижу ещё!";_R7(_z5._t7,_u7);var _u7="Ты неплохо справляешься! Вот тебе факт.##Если по каким-либо причинам меда не хватает для#перезимовки, то первыми начинают умирать рабочие#пчелы, причём ещё до начала нехватки#продовольствия. Жертвуя собой, рабочая пчела#заботится о матке и о сохранности роя.##Отлично! Осталось найти всего четверть от#изначального количества потерявшихся пчёл. Будь#осторожен! Не подходи к пчёлам, если они выглядят#раздражёнными.";
_R7(_z5._t7,_u7);var _u7="Спасибо большое! Кажется ты вернул всех моих пчёл!#Поэтому вот держи ещё один факт!##Производство мёда не даётся легко. Чтобы сделать#100 грамм мёда, одна особь должна облететь#приблизительно 1 000 000 цветов! За один вылет#пчела облетает примерно 1000 цветов. За день таких#вылетов она может совершить до 10.##А нет, кажется где-то ещё одна затерялась, она не#должна была улететь далеко.";_R7(_z5._t7,_u7);var _48="На этом всё, спасибо тебе Большое за помощь! Однако#напоследок у меня для тебя грустный факт.##К сожалению уже почти 70 лет наблюдается#вымирание этих милых и невероятно полезных для#природы существ. Это связано с повсеместной#вырубкой лесов, отсутствием безопасных мест для#ульев, недостатком цветов, использованием#пестицидов, загрязнением почвы и воздуха. Пчёлы#дают нам много натуральных и полезных продуктов:#мед, пыльца, прополис, маточное молочко, воск.#Сельское хозяйство во всём мире рассчитывает на#помощь этих насекомых!";
